import React from 'react'
import Comments from './Comments';


export default function StoredComments() {

    myObj = {"username":"", "body":"", "parentId":null}
    let getKeys = ()=>{
        for (let i=0; i<localStorage.length; i++){
            let myKey = localStorage.key(i);
            myObj = JSON.parse(localStorage.getItem(myKey));
            //console.log(myObj.body)
        }
    }
    //var xyz = myObj.body;
    //console.log(typeof(myObj))
    return (
        <>
            <button onClick={getKeys}>Keys</button>
            <p>{`${myObj.body}`}</p>
            <Comments body={myObj.body}/>
        </>
    )
}
